import React, { useEffect, useState } from "react";
import { useLocation } from "react-router-dom";
import axios from "axios";
import PageHeader from "../components/page/PageHeader";

export default function ComparePage() {
  const { search } = useLocation();
  const params = new URLSearchParams(search);

  const id1 = params.get("p1");
  const id2 = params.get("p2");

  const [result, setResult] = useState(null);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    if (!id1 || !id2) return;

    axios.get("http://localhost:8080/api/products/compare", {
      params: { p1: id1, p2: id2 },
      headers: {
        Authorization: `Bearer ${localStorage.getItem("trip-token")}`
      }
    })
    .then((res) => {
      console.log("COMPARE:", res.data);
      setResult(res.data);
    })
    .catch(err => console.error(err))
    .finally(() => setLoading(false));

  }, [id1, id2]);

  if (loading) return <div className="loading">ƒêang t·∫£i d·ªØ li·ªáu...</div>;
  if (!result) return <div className="error">Kh√¥ng l·∫•y ƒë∆∞·ª£c d·ªØ li·ªáu!</div>;

  const p1 = result.p1;
  const p2 = result.p2;

  return (
    <div>
      {/* ================== HEADER ================== */}
      <PageHeader />

      {/* ================== MAIN CONTENT ================== */}
      <div className="compare-wrapper">

        <h1 className="title">üîç So s√°nh s·∫£n ph·∫©m</h1>

        {/* Hai s·∫£n ph·∫©m */}
        <div className="compare-products">
          {[p1, p2].map((p, index) => (
            <div key={index} className="product-card">
              <img
                src={p.imageUrl || "/no-image.png"}
                alt={p.name}
                className="product-img"
              />

              <h3 className="product-name">{p.name}</h3>
              <p className="product-price">
                {Number(p.price).toLocaleString()}‚Ç´
              </p>
            </div>
          ))}
        </div>

        {/* B·∫£ng th√¥ng s·ªë */}
        <div className="spec-box">
          <h2 className="spec-title">üìå Th√¥ng s·ªë k·ªπ thu·∫≠t</h2>

          <table className="spec-table">
            <tbody>
              {[
                ["Gi√°", p1.price, p2.price],
                ["RAM", p1.ram, p2.ram],
                ["B·ªô nh·ªõ", p1.storage, p2.storage],
                ["Chipset", p1.chipset, p2.chipset],
                ["Camera", p1.camera, p2.camera],
                ["Pin", p1.battery, p2.battery],
                ["M√†n h√¨nh", p1.screenSize, p2.screenSize],
                ["M√†u s·∫Øc", p1.color, p2.color],
              ].map(([label, v1, v2], i) => (
                <tr key={i}>
                  <td className="label">{label}</td>
                  <td className="value">{v1}</td>
                  <td className="value">{v2}</td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>

        {/* AI k·∫øt lu·∫≠n */}
        <div className="ai-box">
          <h2>ü§ñ K·∫øt lu·∫≠n c·ªßa AI</h2>
          <p className="ai-text">{result.aiConclusion}</p>
        </div>
      </div>

      {/* ================== CSS ================== */}
      <style>{`
        .compare-wrapper {
          padding: 30px;
          max-width: 1100px;
          margin: 130px auto 40px auto;
          font-family: Arial;
        }

        .title {
          text-align: center;
          font-size: 30px;
          font-weight: bold;
          margin-bottom: 25px;
        }

        .loading, .error {
          font-size: 20px;
          text-align: center;
          margin-top: 150px;
        }

        .compare-products {
          display: grid;
          grid-template-columns: 1fr 1fr;
          gap: 20px;
          margin-bottom: 30px;
        }

        .product-card {
          background: white;
          border: 1px solid #ddd;
          border-radius: 12px;
          padding: 20px;
          text-align: center;
          box-shadow: 0 3px 10px rgba(0,0,0,0.08);
        }

        .product-img {
          width: 100%;
          height: 260px;
          object-fit: contain;
        }

        .product-name {
          font-size: 20px;
          font-weight: 600;
          margin: 10px 0;
        }

        .product-price {
          font-size: 22px;
          color: #d70018;
          font-weight: bold;
        }

        .spec-box {
          background: white;
          border-radius: 12px;
          padding: 20px;
          border: 1px solid #ddd;
          box-shadow: 0 3px 10px rgba(0,0,0,0.06);
          margin-bottom: 30px;
        }

        .spec-title {
          font-size: 22px;
          font-weight: 700;
          margin-bottom: 15px;
        }

        .spec-table {
          width: 100%;
          border-collapse: collapse;
        }

        .spec-table td {
          padding: 12px;
          border-bottom: 1px solid #eee;
          text-align: center;
        }

        .label {
          background: #f7f7f7;
          font-weight: bold;
          width: 30%;
        }

        .value {
          width: 35%;
        }

        .ai-box {
          background: #fff7d6;
          border-left: 6px solid #f3c000;
          padding: 20px;
          border-radius: 10px;
          font-size: 16px;
          line-height: 1.5;
          box-shadow: 0 3px 10px rgba(0,0,0,0.05);
        }

        .ai-text {
          white-space: pre-wrap;
        }
      `}</style>
    </div>
  );
}
